import React from "react";
import './EventsList.css';

import EventCard from '../../../cards/eventcard/EventCard'

    const event = {"id":10,"movie":{"id":1,"name":"Harry Potter","genre":"ADVENTURE","desc":"harry potter movie stuff","length":"PT2H11M40S","image":"https://media.harrypotterfanzone.com/philosophers-stone-20-years-of-movie-magic-harry-poster.jpg"},"theater":{"id":8,"theaterNumber":1,"seats":10},"startTime":"2022-07-14T10:00:00","endTime":"2022-07-14T11:00:00","tickets_sold":0}

function EventsList() {
    return (  
        <React.Fragment>
        <h3>Events List</h3>
        <div className="eventslist-container">
            <EventCard event={event}/>
        </div>
        </React.Fragment>
    );
}

export default EventsList;
